import React from "react";
import ReactDOM from "react-dom";
import { Provider } from "react-redux";
import { BrowserRouter as Router, Route } from "react-router-dom";
import store from "./store/store";
import "./index.css";
import App from "./App";
import About from "./components/about";
import ContactStatus from "./Contact/container/contactStatus";
import ApodResult from "./Techport/apodResult";
import MrpStatus from "./Mrp/container/mrpStatus";
import IvlStatus from "./Ivl/container/ivlStatus";
import TechportResult from "./Techport/techportResult";

const Index = () => (
  <Provider store={store}>
    <Router>
      <div>
        <Route exact path="/" component={App} />
        <Route path="/about" component={About} />
        <Route path="/contact" component={ContactStatus} />
        <Route path="/mrp" component={MrpStatus} />
        <Route path="/ivl" component={IvlStatus} />
        <Route path="/techport" component={TechportResult} />
      </div>
    </Router>
  </Provider>
);

ReactDOM.render(<Index />, document.getElementById("root"));
